import React, { useState } from 'react';
import API_BASE from '../api';

const Dashboard = ({ setView }) => {
  const [skillsOffer, setSkillsOffer] = useState('');
  const [interests, setInterests] = useState('');
  const [skillsLearn, setSkillsLearn] = useState('');
  const [message, setMessage] = useState('');
  const handleDeleteProfile = async () => {
    if (!window.confirm('Are you sure you want to delete your profile? This action cannot be undone.')) return;
    const token = localStorage.getItem('token');
    try {
      const response = await fetch(`${API_BASE}/profile`, {
        method: 'DELETE',
        headers: { 'Authorization': `Bearer ${token}` }
      });
      if (response.ok) {
        localStorage.removeItem('token');
        localStorage.removeItem('userId');
        window.location.reload(); // Or setView to welcome
      } else {
        setMessage('Error deleting profile');
      }
    } catch (error) {
      setMessage('Network error');
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    const token = localStorage.getItem('token');
    if (!token) {
      setMessage('Not logged in');
      return;
    }
    try {
      const response = await fetch(`${API_BASE}/profile`, {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
          'Authorization': `Bearer ${token}`
        },
        body: JSON.stringify({
          skillsOffer: skillsOffer.split(',').map(s => s.trim()),
          interests: interests.split(',').map(s => s.trim()),
          skillsLearn: skillsLearn.split(',').map(s => s.trim())
        }),
      });
      const data = await response.json();
      if (response.ok) {
        setMessage('Profile created successfully!');
      } else {
        setMessage(data.message || 'Error creating profile');
      }
    } catch (error) {
      setMessage('Network error');
    }
  };

  return (
    <div className="page fade-in">
      <div className="profile-card" style={{ textAlign: 'center', marginBottom: '30px' }}>
        <h2>üéâ Welcome to SkillSwap!</h2>
        <p>Connect with peers, share skills, and learn together. Build your profile and start exploring!</p>
      </div>
      <div className="profile-card">
        <h3>üìù Complete Your Profile</h3>
        <form onSubmit={handleSubmit}>
          <input
            type="text"
            placeholder="Skills I can offer (comma separated)"
            value={skillsOffer}
            onChange={(e) => setSkillsOffer(e.target.value)}
            required
          />
          <input
            type="text"
            placeholder="Interests (comma separated)"
            value={interests}
            onChange={(e) => setInterests(e.target.value)}
            required
          />
          <input
            type="text"
            placeholder="Skills I want to learn (comma separated)"
            value={skillsLearn}
            onChange={(e) => setSkillsLearn(e.target.value)}
            required
          />
          <button type="submit">Save Profile ‚ú®</button>
        </form>
        {message && <p style={{ color: message.includes('success') ? 'green' : 'red' }}>{message}</p>}
      </div>
      <div style={{ display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(200px, 1fr))', gap: '20px', marginTop: '30px' }}>
        <div className="profile-card" style={{ textAlign: 'center', cursor: 'pointer' }} onClick={() => setView('explore')}>
          <h3>üîç Explore Profiles</h3>
          <p>Find people to connect with</p>
        </div>
        <div className="profile-card" style={{ textAlign: 'center', cursor: 'pointer' }} onClick={() => setView('messages')}>
          <h3>üí¨ My Messages</h3>
          <p>Chat with your connections</p>
        </div>
        <div className="profile-card" style={{ textAlign: 'center', cursor: 'pointer', background: 'rgba(255, 0, 0, 0.1)' }} onClick={handleDeleteProfile}>
          <h3>üóëÔ∏è Delete Profile</h3>
          <p>Remove your account</p>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
